const Nav = () => {
  return (
    <nav>
      <div>
        <ul>
          <li>Dashboard</li>
          <li>Tickets</li>
          <li>Vendors</li>
          <li>Contracts</li>
          <li>Commodities</li>
          <li>Reports</li>
        </ul>
      </div>
    </nav>
  );
};

export default Nav;
